function activateBadge(data, badgeNumber) {
    console.log("====Activate Badge====>", data)
    let groupNumber = badgeNumber.split('.')[0];

    let badgeFound = false;


    for (const group of Object.values(data)) {
        const groupBadgeNumber = group.groupBadge.number.split('.')[0];

        group.groupBadge.isActive = groupBadgeNumber === groupNumber;

        badgeFound = badgeFound || group.groupBadge.isActive;

        for (const set of Object.values(group.dataset_s)) {
            set.setBadge.isActive = set.setBadge.number === badgeNumber;

            badgeFound = badgeFound || set.setBadge.isActive;
        }
    }

    if (!badgeFound) {
        throw new Error(`Badge number ${badgeNumber} not found.`);
    }
    console.log("====Activate Badge====>", data)
    return data;
}


function handleEvent(msg, datagroup_s) {
    console.log("====Handle Event Entry====>", msg)
    if (msg.payload.event.submit === "next") {
        for (let i = 0; i < datagroup_s.length; i++) {
            const dataset_s = datagroup_s[i].dataset_s;

            for (let j = 0; j < dataset_s.length; j++) {
                const setBadge = dataset_s[j].setBadge;

                if (setBadge.isActive) {
                    setBadge.isActive = false;

                    if (dataset_s[j + 1]) {
                        dataset_s[j + 1].setBadge.isActive = true;
                    } else if (datagroup_s[i + 1]) {
                        datagroup_s[i + 1].dataset_s[0].setBadge.isActive = true;
                        datagroup_s[i + 1].groupBadge.isActive = true;
                        datagroup_s[i].groupBadge.isActive = false;
                    }

                    return datagroup_s;
                }
            }
        }
    }
    else if (msg.payload.event.submit === "previous") {
        for (let i = datagroup_s.length - 1; i >= 0; i--) {
            const dataset_s = datagroup_s[i].dataset_s;

            for (let j = dataset_s.length - 1; j >= 0; j--) {
                const setBadge = dataset_s[j].setBadge;

                if (setBadge.isActive) {
                    setBadge.isActive = false;

                    if (dataset_s[j - 1]) {
                        dataset_s[j - 1].setBadge.isActive = true;
                    } else if (datagroup_s[i - 1]) {
                        const prevDataset_s = datagroup_s[i - 1].dataset_s;
                        prevDataset_s[prevDataset_s.length - 1].setBadge.isActive = true;
                        datagroup_s[i - 1].groupBadge.isActive = true;
                        datagroup_s[i].groupBadge.isActive = false;
                    }

                    return datagroup_s;
                }
            }
        }
    }
    console.log("====Handle Event====>", datagroup_s)
    return datagroup_s;
}


